/* Model applicator */
double ApplyCatboostModel2(
    const std::vector<float>& features
) {
    const struct CatboostModel2& model2 = CatboostModelStatic2;

    /* Binarise features */
    std::vector<unsigned char> binaryFeatures(model2.BinaryFeatureCount);
    unsigned int binFeatureIndex = 0;
    for (unsigned int i = 0; i < model2.FloatFeatureCount; ++i) {
        for(unsigned int j = 0; j < model2.BorderCounts[i]; ++j) {
            binaryFeatures[binFeatureIndex] = (unsigned char)(features[i] > model2.Borders[binFeatureIndex]);
            ++binFeatureIndex;
        }
    }

    /* Extract and sum values from trees */
    double result = 0.0;
    const unsigned int* treeSplitsPtr = model2.TreeSplits;
    const double* leafValuesForCurrentTreePtr = model2.LeafValues;
    for (unsigned int treeId = 0; treeId < model2.TreeCount; ++treeId) {
        const unsigned int currentTreeDepth = model2.TreeDepth[treeId];
        unsigned int index = 0;
        for (unsigned int depth = 0; depth < currentTreeDepth; ++depth) {
            index |= (binaryFeatures[treeSplitsPtr[depth]] << depth);
        }
        result += leafValuesForCurrentTreePtr[index];
        treeSplitsPtr += currentTreeDepth;
        leafValuesForCurrentTreePtr += (1 << currentTreeDepth);
    }
    return model2.Scale * result + model2.Bias;
}

double ApplyCatboostModel2(
    const std::vector<float>& floatFeatures,
    const std::vector<std::string>&
) {
    return ApplyCatboostModel2(floatFeatures);
}

class Model_nonVBS : public multidraw::TTreeFunction {
public:

  Model_nonVBS();

  char const* getName() const override { return "Model_nonVBS"; }
  TTreeFunction* clone() const override { return new Model_nonVBS(); }

  bool initialized_ = false;
  std::string model_path_;
  unsigned getNdata() override { return 1; }
  double evaluate(unsigned) override;

protected:

  bool verbose;
  void bindTree_(multidraw::FunctionLibrary&) override;
  CatboostModel2 cat2;
  FloatValueReader* mjj{};
  FloatValueReader* detajj{};
  FloatValueReader* dphijj{};
  UIntValueReader* nLepton{};
  FloatArrayReader* Lepton_pt{};
  FloatArrayReader* Lepton_eta{};
  UIntValueReader* nCleanJet{};
  FloatArrayReader* CleanJet_pt{};
  FloatArrayReader* CleanJet_eta{};
  FloatValueReader* MET_pt{};
  FloatValueReader* ptll{};
};


Model_nonVBS::Model_nonVBS()
{
   ;
}

double
Model_nonVBS::evaluate(unsigned)
{
  unsigned nL{*nLepton->Get()};
  unsigned nJ{*nCleanJet->Get()};
  if(nL<2 || nJ<2){
    return -999.;
  }
  std::vector<float> input{};
  input.push_back( *(mjj->Get()) );
  input.push_back( *(detajj->Get()) );
  input.push_back( *(dphijj->Get()) );
  input.push_back( CleanJet_pt->At(0) );
  input.push_back( CleanJet_pt->At(1) );
  input.push_back( Lepton_pt->At(0) );
  input.push_back( Lepton_pt->At(1) );
  input.push_back( *(MET_pt->Get()) );
  input.push_back( *(ptll->Get()) );
  float _detajj=*(detajj->Get());
  float zlep1=std::abs((Lepton_eta->At(0)-(CleanJet_eta->At(0)+CleanJet_eta->At(1))/2)/_detajj);
  float zlep2=std::abs((Lepton_eta->At(1)-(CleanJet_eta->At(0)+CleanJet_eta->At(1))/2)/_detajj);
  input.push_back(zlep1);
  input.push_back(zlep2);

  //aliases['zlep1'] = {'expr' : '(Alt$(Lepton_eta[0],-9999.) - (Alt$(CleanJet_eta[0],-9999.)+Alt$(CleanJet_eta[1],-9999.))/2)/detajj'}
  double rawFormulaVal=ApplyCatboostModel2(input);
  return exp(rawFormulaVal)/(1+exp(rawFormulaVal));

}
void
Model_nonVBS::bindTree_(multidraw::FunctionLibrary& _library)
{
  _library.bindBranch(mjj, "mjj");
  _library.bindBranch(detajj, "detajj");
  _library.bindBranch(dphijj, "dphijj");
  _library.bindBranch(nLepton, "nLepton");
  _library.bindBranch(Lepton_pt, "Lepton_pt");
  _library.bindBranch(Lepton_eta, "Lepton_eta");
  _library.bindBranch(nCleanJet, "nCleanJet");
  _library.bindBranch(CleanJet_pt, "CleanJet_pt");
  _library.bindBranch(CleanJet_eta, "CleanJet_eta");
  _library.bindBranch(MET_pt, "MET_pt");
  _library.bindBranch(ptll, "ptll");
}

